import React from "react";
import { connect } from "react-redux";

const techCard = ({tech: { techs }}) => {
    console.log(current)
  return (
    <div id="tech-profile-modal" className="modal">
      <div id="tech-profile-modal" className="modal-content ">
        <div className="card">
          <div
            className="card-image waves-effect waves-block waves-light"
            style={{
              top: "15px",
              left: "200px",
              width: 250,
              height: 250,
              borderRadius: "50%",
            }}
          >
            <img
              src={
                "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTw92ToLJnjnUmsEbTRFStNtKCD-PJBRbnqYg&usqp=CAU"
              }
              className="activator"
              alt="ProfilePic"
            />
          </div>
          <div className="card-content">

                    <ul className="collection">
                    <li className="collection-item">Full Name</li>
                    <li className="collection-item">Age</li>
                    <li className="collection-item">Department</li>
                    <li className="collection-item">Working since</li>
                   </ul>

          </div>

        </div>
      </div>
      <div className="modal-footer">
        <a href="#!" className="modal-close waves-effect red btn">
          Go Back
        </a>
      </div>
    </div>
  );
};


const mapStateToProps = state =>({
    current:state.tech.current
  })

export default connect(mapStateToProps,{})(techCard);
